import React from 'react';
import OrdersHistoryHeaderTable from './OrdersHistoryHeaderTableComponent';
import noImage from '../../../assets/personal-account/noImage.png';

const OrdersHistoryTable = ({ ordersArray }) => (
  <div className="ordersHistory-box">
    <h2 className="orders"> История заказов</h2>
    <ul className="listOrder-wrap">
      <div className="title">
        <p className="titleGood">Товар</p>
        <p className="titleQuantity">Количество</p>
        <p className="titleAmount">Сумма</p>
      </div>
      { ordersArray.map((order) => (
        <li key={order.id}>
          <div className="columns">
            <div className="columnGood">
              <img
                className="orderImage"
                src={order.image === null ? noImage : order.image}
                alt="orderImage"
                title="orderImage"
              />
              <h4 className="columnGoodNameTitle">
                {order.description}
              </h4>
            </div>
            <div className="columnQuantity">
              {order.counter}
            </div>
            <p className="columnAmount">
              {order.sum}
              {' '}
              руб.
            </p>
          </div>
        </li>
      ))}
    </ul>
  </div>
);

export default OrdersHistoryTable;
